description:
Verenigde Staten
Komedie
98 minuten

geregisseerd door Paul Weitz
met Robert De Niro, Ben Stiller en Dustin Hoffman

Aangezien hij het toch nooit goed bij hem kan doen, heeft Greg Focker (Ben Stiller) nog steeds moeite om met zijn schoonvader Jack Byrnes (Robert De Niro) om te gaan. Dit helpt Greg niet echt om groot nieuws over te brengen op de voormalig CIA-agent; Pamela (Teri Polo), de vrouw van Greg is namelijk in verwachting van hun eerste kind. Hoe zullen de opa's en oma's, maar vooral Jack, op dit nieuws reageren?

